def encode_point(plaintext: int):
    plaintext <<= 8
    while True:
        x = plaintext
        y = sqrt_mod(x**3+a*x+b, p)
        if y:
            break
        plaintext += 1
    return ecdsa.ellipticcurve.PointJacobi(curve.curve, x, y, 1)

def decode_point(point):
    return int(point.x()) >> 8

# refer: https://crypto.stackexchange.com/questions/20627/point-decompression-on-an-elliptic-curve
def compress_point(point):
    return (point.x() << 1) + (point.y() & 1)

def decompress_point(pointint):
    x = pointint >> 1
    y = sqrt_mod(x**3+a*x+b, p)
    if y & 1 == pointint & 1:
        return ecdsa.ellipticcurve.PointJacobi(curve.curve, x, y, 1)
    else:
        return ecdsa.ellipticcurve.PointJacobi(curve.curve, x, p-y, 1)

def keygen():
    keyb = ecdsa.SigningKey.generate(curve=curve)
    Pb = keyb.privkey.public_key.point
    nB = keyb.privkey.secret_multiplier
    return (Pb, nB)

def encrypt(Pmint, bobkeypub):
    Pb = bobkeypub
    Pm = encode_point(Pmint)
    k = random.randint(2, order-1)
    Pc = (k) * G, Pm + k * Pb
    return compress_point(Pc[0]), compress_point(Pc[1])

def decrypt(Pcint, bobkeysecret):
    nB = bobkeysecret
    Pc = decompress_point(Pcint[0]), decompress_point(Pcint[1])
    Pm = Pc[1] + (-nB) * Pc[0]	
    return decode_point(Pm)

